const characterImages = [
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",

]

const clothesImages = [
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",

]

const config = requestFromUser("Change clothes", "", function() {
return [
this.section("Mode", "Choose the mode may match your original input image.", [
this.segmented(1, ["half body", "full dress"])
]), 
this.section("Character", "What character model you would prefer to try on new clothes? (ignore this step, if you alread setup your model image in previous steps)", [
this.image(characterImages, null, true)
]),
this.section("Clothes", "What clothes you would prefer to try?", [
this.image(clothesImages, null, true)
]),
]
});

const mode = config[0][0];
const character = config[1][0];
const clothe = config[2][0];


if (clothe != 0) {
  console.log("load cloths to moodboard")
  canvas.clearMoodboard();
  canvas.addToMoodboardFromSrc(clothesImages[clothe]);
}

if (character != 0) {
console.log("load model image")
canvas.loadImageSrc(characterImages[character])
}


const boundingBox = canvas.boundingBox;

const aspectRatio = boundingBox.width / boundingBox.height;
const configuration = pipeline.configuration;
if (aspectRatio < 1) {
configuration.width = Math.ceil(16 * aspectRatio) * 64;
configuration.height = 1024;
} else {
configuration.width = 1024;
configuration.height = Math.ceil(16 / aspectRatio) * 64;
}

canvas.updateCanvasSize(configuration);
const zoom = Math.min(Math.floor(configuration.width / boundingBox.width * 60) / 60, Math.floor(configuration.height / boundingBox.height * 60) / 60);
canvas.canvasZoom = zoom;
// Now center the image, whatever that should be.
canvas.moveCanvas(boundingBox.x + Math.round((boundingBox.width - configuration.width / zoom) * 0.5), boundingBox.y + Math.round((boundingBox.height - configuration.height / zoom) * 0.5));


configuration.strength = 1;
configuration.seed = -1;

console.log("Change clothes");
if (mode == 0) {
pipeline.downloadBuiltins(["ootd_vton_1.0_f16.ckpt", "ootd_garm_1.0_f16.ckpt", "schp_atr_fp16.ckpt", "schp_lip_fp16.ckpt"]);
configuration.model = "ootd_vton_1.0_f16.ckpt";
backgroundMask = canvas.bodyMask(["upper"], true);
console.log("load upper mask");
canvas.loadMaskFromSrc(backgroundMask.src)
ootdControl = pipeline.findControlByName("Garment UNet (Outfitting Fusion 1.0)");
ootdControl.weight = 1;
ootdControl.guidanceEnd = 0.6;
} else {
pipeline.downloadBuiltins(["ootd_vton_full_body_1.0_f16.ckpt", "ootd_garm_full_body_1.0_f16.ckpt", "schp_atr_fp16.ckpt", "schp_lip_fp16.ckpt"]);
configuration.model = "ootd_vton_full_body_1.0_f16.ckpt";
backgroundMask = canvas.bodyMask(["upper", "dress"], true);
console.log("load upper dress mask");
canvas.loadMaskFromSrc(backgroundMask.src)
ootdControl = pipeline.findControlByName("Garment UNet (Full-Body, Outfitting Fusion)");
ootdControl.weight = 1;
ootdControl.guidanceEnd = 0.6;
}




(function () {
  // If backgroundMask is none, we can not do virtual try on, return
  if (backgroundMask == 0) {
    return;
  }

  
configuration.guidanceScale = 2.0;
configuration.sampler = 0;
configuration.steps = 16;
configuration.preserveOriginalAfterInpaint = false;
configuration.hiresFix = false;
configuration.controls = [ootdControl];
pipeline.run({ configuration: configuration, prompt: "", mask:backgroundMask });
})();